import React from 'react';
import './index.css';



const App = () => (
  <div className='app'>
    <Navigation />
    <Main />
  </div>
);

const Navigation = () => (
  <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Navbar.Brand href="#home">Scan Me</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
              <Nav className="mr-auto">
                <ul>
                <li><NavLink exact activeClassName="current" to="/">Home</NavLink></li>
                <li><NavLink exact activeClassName="current" to="/Cart">Cart</NavLink></li>
                <li><NavLink exact activeClassName="current" to="/Scan">Scan</NavLink></li>
                </ul>
              </Nav>
            </Navbar.Collapse>
          </Navbar>
  );

  const Home = () => (
    <div className='home'>
      <h1>Welcome to my portfolio website</h1>
      <p> Feel free to browse around and learn more about me.</p>
    </div>
  );

  const Cart = () => (
    <div className='cart'>
      <h1>About Me</h1>
      <p>Ipsum dolor dolorem consectetur est velit fugiat. Dolorem provident corporis fuga saepe distinctio ipsam? Et quos harum excepturi dolorum molestias?</p>
      <p>Ipsum dolor dolorem consectetur est velit fugiat. Dolorem provident corporis fuga saepe distinctio ipsam? Et quos harum excepturi dolorum molestias?</p>
    </div>
  );

  const Scan = () => (
    <div className='scan'>
      <h1>Contact Me</h1>
      <p>You can reach me via email: <strong>hello@example.com</strong></p>
    </div>
  );

  const Main = () => (
    <Switch>
      <Route path='/' component={Home}></Route>
      <Route path='/Cart' component={Cart}></Route>
      <Route path='/Scan' component={Scan}></Route>
    </Switch>
  );

export default App;
